import { Menu, Button } from "antd";
const MenuNavibarLayout = ({ children }) => {
  return (
    <div style={{ marginTop: "10px" }}>
      <Menu mode="horizontal">
        <Menu.Item key={"home"}>test</Menu.Item>
        <Menu.Item key={"test"}>test</Menu.Item>
        <Menu.Item key={"test1"}>test</Menu.Item>
      </Menu>
      {children}
    </div>
  );
};

export default MenuNavibarLayout;
